import { useState } from 'react'

function CountInButton() {
    const [number, setNumber] = useState(0)
    const getNewNumber = () => {
        setNumber(number + 1)
    }
    return <button onClick={() => getNewNumber()}>{number}</button>
}

export default CountInButton
